import {uploadPhoto, createUser} from './utils.js'

function handleProfileSignup() {
  uploadPhoto
    .then((obj) => {
      createUser
        .then((nms) => console.log(`${obj.body} ${nms.firstName} ${nms.lastName}`))
    })
    .catch(() => console.log('Signup system offline'))
}

